import { Typography } from "@mui/material";

export default function Uploads() {
  return (
    <>
      <Typography variant="h5" gutterBottom>
        Uploaduri
      </Typography>

      <Typography color="text.secondary">
        Aici poți adăuga upload IPFS pentru NFT-uri.
      </Typography>
    </>
  );
}
